import React from "react";

import Calendar from "../../componenets/calendar/calendar"

export class Home extends React.Component {

    render() {
        return (
            <div className="loginSiteWrapper">
                <h3 className="h3">
                    <i className="far fa-calendar-alt"/> Calendar
                </h3>
                <div id=" calendar" class=" container-fluid calendar">
                    <Calendar/>
                </div>
            </div>
        )
    }

}

export default Home;
